import React from 'react';
import './Patch.css';
import PatchRow from "../PatchRow/PatchRow";

class Patch extends React.Component {
  render() {
    return (
      <div className="patch">
        <PatchRow pumpkins={[]}/>
      </div>
    );
  }
}

export default Patch;
